import React, { PureComponent } from 'react';

const Rectangle = (props)=> {

    const style = {width: `${this.props.width}px`, height: `${this.props.heigth}px`, backgroundColor: `${this.props.bgColor}`, borderRadius: `10px`, boxShadow: `0 5px 10px gray`}

    return (
        <div style={this.style}></div>
    );

}

export default Rectangle;
